import React from 'react';
import './App.scss';
import Header from './components/header';
import Agenda from './components/agenda';
import Contact from './components/contact';
import RSVP from './components/rsvp';

function App() {
  return (
    <div className="App">
        <Header />
        <RSVP />
        <Agenda />
        <Contact />
        <RSVP />
    </div>
  );
}

export default App;
